post_content = "<h3>Farming and Community Group Drought Funding</h3>
<h3>Description</h3>
This grant is provided by the Vitorian government for building resilience to drought and its conditions beforehand. Program is open to various groups like landcare, industry, farming system etc. Preferences will be given to the projects that are in Wellington or East Gippsland shires, far North-West Vitoria and the Goulburn Murray Irrigation District.
<h3>Eligibility</h3>
Eligible Victorian groups include:
<ul>
 	<li>landcare and land management groups (for example, Landcare Network)</li>
 	<li>farmer discussion and producer groups not for profit community organisations (including incorporated bodies, cooperatives or associations, (for example, agribusiness groups, development associations)).</li>
</ul>
<h3>How to apply</h3>
Call 136186 or visit the web page <a style=\"text-decoration-line: underline; transition-duration: 0.3s; transition-timing-function: ease; color: #337ab7; outline: none; font-family: 'Open Sans', GlacialIndifference, sans-serif; font-size: 15px;\" href=\"https://business.vic.gov.au/grants-and-programs/farming-and-community-group-drought-funding/\">HERE</a>.
<figure>
											<a href=\"https://business.vic.gov.au/grants-and-programs/farming-and-community-group-drought-funding\" target=\"_blank\" rel=\"noopener\">
<img width=\"414\" height=\"186\" src=\"/wp-content/uploads/2021/08/bv.png\" alt=\"\" loading=\"lazy\">								</a><figcaption></figcaption></figure>
<h4>Contact</h4>
<ul>
 	<li>
											<a href=\"tel:136186\">
136186
</a></li>
 	<li>
											<a href=\"https://business.vic.gov.au/grants-and-programs/farming-and-community-group-drought-funding\">
business.vic.gov.au/grants-and-programs
</a></li>
</ul>"
